import React, { useState } from 'react';
import WagonsPanel from "./WagonsPanel";
import SeastPanel from './SeatsPanel';

function BottomPanel({ currentTrain, handleWagonChange, current_wagon_index}) {

  return (
    <>
      <WagonsPanel currentTrain={currentTrain} focusOnWagonClick={handleWagonChange}/>
      <SeastPanel currentWagon={currentTrain.wagons[current_wagon_index]} />
    </>
  );
}
  
export default BottomPanel;
